//capturePhotoRipple() - Gets the document id from the html document
//create a variable for the base64 photo
//send the base64 to the document id - src="base64"  
function capturePhotoRipple() { 
	var smallImage = document.getElementById('smallImage'); 
	smallImage.style.display = 'block'; 
	var imageData = ""
	smallImage.src = "data:image/jpeg;base64," + imageData; 
	$('#photodata').val(imageData);
}

//captureVideoRipple() - Gets the document id from the html document
//create a variable for the base64 photo
//load the video from the base 64
//send the base64 to the document id - src="base64"  
function captureVideoRipple() { 
	var video = document.getElementById('video'); 
	video.style.display = 'block'; 
	var videoData = "";
	video.src = "data:video/mp4;base64," + videoData ;
	document.getElementById('playload').load();
	$('#videodata').val(videoData);
}